CREATE TABLE `ept_report` (
  `id` varchar(60) DEFAULT NULL,
  `instance` varchar(60) DEFAULT NULL,
  `remoteIp` varchar(255) DEFAULT NULL,
  `type` varchar(20) DEFAULT NULL,
  `platform` varchar(255) DEFAULT NULL,
  `version` varchar(20) DEFAULT NULL,
  `customerCount` int(11) DEFAULT NULL,
  `orderCount` int(11) DEFAULT NULL,
  `scoreCount` int(11) DEFAULT NULL,
  `faultCount` int(11) DEFAULT NULL,
  `staffCount` int(11) DEFAULT NULL,
  `menuCount` int(11) DEFAULT NULL,
  `textCount` int(11) DEFAULT NULL,
  `content` text,
  `submitTime` varchar(60) DEFAULT NULL,
  `createTime` bigint(20) DEFAULT NULL,
  `creator` varchar(60) DEFAULT NULL,
  `remark` varchar(255) DEFAULT NULL,
  KEY `IDX_INSTANCE` (`instance`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;



